import React from "react";
import { Avatar, Container, Grid, Paper, Typography } from "@mui/material";
import { styled } from "@mui/material/styles";
import rapperLogo from "../../resources/creators/rapper.png";
import directorLogo from "../../resources/creators/director2.png";
import beatProducerLogo from "../../resources/creators/beatProducer.png";
import mixMasteringLogo from "../../resources/creators/mixMastering.png";

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

const Creators = () => {
  return (
    <Container
      sx={{
        background: "linear-gradient(to left, #403A3E , #BE5869)",
        height: "90vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <Item
            sx={{ background: "linear-gradient(to left, #403A3E , #BE5869)" }}
          >
            <Avatar
              className="ripple"
              alt="Remy Sharp"
              src={rapperLogo}
              sx={{ m: "auto", width: 200, height: 200 }}
            />
            <Typography variant="subtitle1">Rappers</Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Item
            sx={{ background: "linear-gradient(to left, #403A3E , #BE5869)" }}
          >
            <Avatar
              className="ripple"
              alt="Remy Sharp"
              src={directorLogo}
              sx={{ m: "auto", width: 250, height: 250 }}
            />
            <Typography variant="subtitle1">Directors</Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Item
            sx={{ background: "linear-gradient(to left, #403A3E , #BE5869)" }}
          >
            <Avatar
              className="ripple"
              alt="Remy Sharp"
              src={beatProducerLogo}
              sx={{ m: "auto", width: 200, height: 200 }}
            />
            <Typography variant="subtitle1">Beat Producers</Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Item
            sx={{ background: "linear-gradient(to left, #403A3E , #BE5869)" }}
          >
            <Avatar
              className="ripple"
              alt="Remy Sharp"
              src={mixMasteringLogo}
              sx={{ m: "auto", width: 200, height: 200 }}
            />
            <Typography variant="subtitle1">Mix Masters</Typography>
          </Item>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Creators;
